    子弹属性.子弹散射度 = 0;
    子弹属性.发射效果 = "";
    子弹属性.子弹种类 = "铁血飞弹";
    子弹属性.子弹威力 = _parent._parent.空手攻击力 * 5;
    子弹属性.子弹速度 = 30;
    子弹属性.击中地图效果 = "";
    子弹属性.Z轴攻击范围 = 30;
    子弹属性.击倒率 = 1;
    子弹属性.击中后子弹的效果 = "铁血弹爆炸";

    // 击退速度设置为NaN（原代码中没有击退速度参数）
    子弹属性.水平击退速度 = NaN;
    子弹属性.垂直击退速度 = NaN;
    子弹属性.伤害类型 = "破击";
    子弹属性.魔法伤害属性 = "原体";
   if (_parent._parent.宠物属性.追踪飞弹){
	   子弹属性.子弹种类 = "追踪铁血飞弹";
	   if(_root.成功率(50)){
    		子弹属性.伤害类型 = "魔法";
    		子弹属性.魔法伤害属性 = undefined;
	   }
   }

